import React, { Component } from 'react';
import logo from './logo.png';
import {Form, FormGroup, Label, Navbar, NavbarText} from 'reactstrap'

class CompanyRegister extends Component {
    render() {
        return (
            <div>
                <div>
                    <img src={logo} alt=""/>
                </div>
                <Navbar color="blue">
                    <NavbarText>Company Register/Edit</NavbarText>
                </Navbar>
                <Form>
                    <FormGroup row>
                        <Label for="company_name" sm={2}>Company Name</Label>
                    </FormGroup>
                </Form>

            </div>
        );
    }
}

export default CompanyRegister;
